import React from 'react';
import './style.css';

const ImgCard = props => (
  <div
      id={props.name}
      onClick={() => props.handleClick(props.name)}
    >
      <div id="img-thumbnail" alt={props.name} src={props.img_url} />
  </div>
);

export default ImgCard;
